            <img src ='./assets/img/ava2.jpg'></img>
            <img src ='./assets/img/ava3.jpg'></img>
            <img src ='./assets/img/blog1.jpg'></img>
            <img src ='./assets/img/blog2.jpg'></img>
        </div>
    )
}
export default MenuBox
